const routes = require('next-routes')();

routes
    .add('/campaigns/new','/campaigns/new')
    .add('/campaigns/:address', '/campaigns/show')
    .add('/campaign/:address/requests', '/campaigns/:address/requests/index');

module.exports = routes;
